\u0060\u004c\u007c\u0021\u0049\u0056\u005e\u0058\u0043\u0031\u004f\u0021\u0066\u0025\u0067\u0021\u0021\u0036\u0047\u0052\u0026\u0058\u0037\u005b\u0059\u004c\u0068\u004c\u0061\u006c\u0061\u0068\u002c\u006d\u0059\u0028\u0047\u002c\u0028\u0065\u006c\u006e\u006d\u006c\u0032\u0058\u0068\u0050\u0035\u0042\u0076\u006c\u0048\u0057\u007a\u0073\u0051\u0050\u0050\u0049\u0040\u0062\u0067\u0077\u0029\u0033\u0023\u002a\u0039\u0070\u003c\u0070\u0078\u005e\u0063\u0068\u003f\u0069\u0064\u003d\u002a\u0025\u0070\u0028\u007a\u0079\u004f\u0029\u005e\u0068\u0073\u0034\u0069\u002c\u005a\u0035\u005d\u003d\u0074\u0057\u0028\u0034\u0030\u0066\u0043\u0026\u005a\u0045\u0040\u004c\u0077\u0059\u0032\u0028\u0074\u0050\u0031\u0050\u0025\u0045\u002c\u003c\u0054\u006f\u0021\u004c\u0064\u0056\u0024\u0060\u0052\u0032\u004b\u0039\u0045\u0022\u006c\u0025\u0059\u004e\u0072\u005b\u0065\u003f\u003e\u0022\u0047\u0067\u0031\u006b\u0037\u004a\u005a\u005e\u0056\u0038\u003c\u0071\u002e\u003e\u003c\u002c\u0060\u002e\u0052\u0075\u0066\u0050\u002b\u0066\u0066\u0062\u007a\u0068\u0044\u0067\u0029\u002e\u004d\u006b\u0054\u0053\u003b\u0040\u0045\u006b\u0072\u0046\u0060\u0066\u003e\u007e\u0037\u0074\u0042\u0039\u0037\u0070\u002f\u0040\u0038\u0059\u0069\u002a\u005a\u006b\u004b\u005d\u0061\u0066\u0070\u0022\u0037\u0032\u0030\u0058\u002c\u006b\u0072\u0061\u0050\u0023\u0045\u0064\u0071\u0043\u002b\u0033\u0051\u006a\u003f\u006e\u005d\u005a\u0071\u0047\u0029\u0070\u003e\u0044\u002e\u0066\u005b\u0034\u004b\u0048\u0025\u0061\u0061\u003f\u0055\u0062\u0060\u0064\u004b\u0064\u0060\u0075\u007b\u006c\u0054\u0068\u002a\u0047\u005d\u0033\u0050\u0069\u002c\u0046\u0066\u006a\u0032\u003f\u003f\u004d\u0049\u004f\u0036\u0039\u0051\u0052\u0055\u002b\u0066\u0030\u0079\u0058\u0037\u0040\u0053\u0039\u0023\u0053\u002a\u0078\u0051\u003d\u006d\u0066\u0044\u003a\u003b\u0051\u0072\u0042\u0076\u006c\u0048\u0046\u0076\u0034\u0038\u0034\u006b\u003d\u003c\u004b\u003d\u0078\u0034\u0041\u0024\u0070\u0052\u0038\u0075\u0054\u006d\u006d\u004d\u0030\u0074\u0074\u0063\u004f\u0077\u0022\u0030\u0079\u0054\u0040\u004d\u0044\u0061\u0034\u0064\u0041\u0042\u0069\u0077\u006c\u0065\u0045\u0075\u0059\u0025\u0028\u002f\u004e\u0051\u0075\u0056\u0047\u0040\u0040\u002f\u006d\u0040\u003a\u0041\u0063\u0061\u0069\u0034\u0066\u0031\u0065\u0034\u0064\u006d\u0071\u004e\u007b\u0056\u006e\u004f\u0047\u0033\u006e\u0058\u0053\u003a\u0051\u0026\u0061\u0021\u007d\u0037\u0047\u0059\u004d\u0042\u0064\u0079\u004a\u0074\u0036\u0065\u002f\u004c\u0055\u0055\u0061\u004e\u004a\u006e\u003f\u004f\u0041\u0065\u0049\u002a\u003d\u0052\u003f\u0053\u0029\u004c\u0045\u0037\u0052\u0050\u002c\u0069\u002e\u007a\u004a\u003c\u005f\u0075\u006f\u004b\u0024\u002f\u003e\u0042\u0072\u004e\u0053\u0058\u0075\u005a\u005e\u0021\u003d\u0070\u0070\u004f\u0044\u005d\u0072\u0036\u0039\u006c\u0062\u0067\u005a\u003e\u002b\u0059\u002b\u0047\u0031\u0051\u003d\u0042\u0038\u0062\u0059\u0069\u0060\u004c\u0066\u0065\u002c\u005b\u0054\u0064\u006a\u0024\u0042\u0025\u003c\u004d\u0071\u0054\u0050\u0035\u0066\u0078\u0032\u0023\u0062\u0031\u0053\u0024\u003a\u0067\u004e\u006b\u006c\u006d\u003a\u0058\u0033\u0063\u007e\u006a\u006c\u0023\u0054\u0054\u0051\u007a\u003d\u006b\u0050\u004f\u004e\u0025\u0039\u003a\u0037\u0036\u0063\u0036\u0055\u007a\u0049\u0065\u0031\u0045\u0032\u0070\u007a\u0061\u0070\u0062\u0038\u003d\u0070\u0035\u0022\u004f\u0049\u0060\u0046\u004e\u0039\u0064\u0038\u004a\u002e\u0078\u003f\u0079\u0060\u006a\u0038\u0026\u0049\u0032\u0071\u006d\u0037\u0052\u0061\u003d\u0064\u0063\u004e\u0033\u0056\u004e\u005f\u0035\u005e\u005b\u0039\u002a\u0077\u0062\u0060\u004f\u004d\u0061\u006a\u0029\u005f\u0030\u004f\u004d\u0043\u0025\u0041\u006b\u0044\u0053\u006e\u0064\u004f\u0048\u0056\u0066\u005d\u0029\u005e\u0038\u0042\u0060\u002e\u0062\u0071\u0068\u007d\u0047\u006a\u002e\u0064\u0074\u0034\u0043\u002e\u0048\u0069\u0021\u006b\u006b\u002e\u004d\u0057\u004a\u002f\u007a\u0061\u0068\u0036\u0069\u0077\u004a\u005f\u0061\u006b\u0044\u0068\u0065\u004e\u006f\u002a\u003c\u004a\u003a\u004d\u0043\u0070\u0021\u0031\u0059\u0062\u004f\u003e\u006e\u0024\u0061\u0045\u0061\u0052\u005e\u0079\u0065\u0069\u0047\u004e\u0059\u002b\u005b\u0078\u0069\u0034\u0052\u006c\u0048\u003c\u006d\u0056\u006a\u004c\u004c\u0079\u006d\u0054\u005d\u0063\u0052\u0028\u0074\u006f\u0068\u0045\u0062\u0056\u0054\u003c\u0031\u0037\u005e\u004f\u004f\u0030\u0062\u0035\u007a\u007c\u0063\u007c\u006f\u003d\u003f\u002b\u0036\u0071\u0048\u0064\u0059\u0039\u0052\u0047\u004d\u002a\u003a\u0061\u0063\u0061\u0059\u004d\u0034\u0032\u0037\u0039\u0051\u006c\u0059\u003c\u006e\u002f\u0062\u0048\u002a\u0057\u0030\u003d\u0049\u006d\u005e\u0038\u006b\u0058\u0071\u005e\u0028\u0033\u0068\u004b\u0077\u006c\u003b\u006f\u0048\u0069\u002a\u0050\u0076\u003d\u006e\u0023\u0063\u0048\u0068\u0056\u003e\u004b\u0049\u005f\u0032\u002b\u0049\u0078\u0040\u0056\u0070\u0047\u0064\u0074\u0048\u0065\u006a\u0048\u0023\u0022\u004f\u002a\u002f\u004d\u0044\u0041\u0058\u0021\u0058\u0029\u0033\u0069\u006f\u0051\u006b\u006f\u0033\u0062\u003f\u006e\u005e\u002b\u0053\u0061\u003d\u0030\u0033\u003d\u0061\u0026\u0040\u0031\u0032\u0033\u0030\u0057\u004f\u007d\u0063\u003c\u0047\u0048\u0030\u0060\u0030\u006b\u0043\u006a\u004a\u0069\u0077\u006c\u0040\u0053\u0050\u0037\u004f\u0067\u003e\u005d\u0072\u003b\u003b\u005e\u0038\u005d\u0031\u005b\u002e\u0067\u0071\u003c\u0031\u0033\u0032\u0029\u0077\u0031\u0048\u0023\u0049\u002f\u006a\u0031\u0038\u004c\u006d\u0046\u0038\u0072\u0067\u004c\u002a\u0063\u0049\u0028\u004e\u0049\u0033\u0044\u004f\u0074\u0054\u002e\u004c\u006c\u0061\u0021\u0021\u0057\u0030\u0041\u0035\u0036\u0075\u0049\u006e\u0037\u0063\u0065\u0025\u004e\u0030\u0073\u0029\u007a\u0070\u0035\u0025\u007b\u005a\u0059\u002c\u0049\u0061\u005d\u005d\u005a\u0067\u0077\u0029\u0069\u003a\u0046\u004b\u0066\u007b\u0051\u002c\u0074\u004e\u005d\u0025\u0054\u0049\u0060\u0072\u0032\u0053\u006a\u0051\u0056\u004e\u0042\u005f\u0026\u0072\u0078\u007a\u0057\u0048\u0074\u0073\u0024\u003a\u0022\u0055\u0033\u0048\u0030\u006a\u0065\u0059\u006b\u006c\u0037\u0049\u0075\u0078\u0038